import React from 'react';

const data = "http://localhost:8000/pokemons"

export default class Userpage extends React.Component{
    componentDidMount(){
        fetch('https://pokeapi.co/api/v2/pokemon?limit=151').then(res=>res.json()).then(json=>console.log(json))
    }

    render(){
        console.log(data)
        return(
            <>
                <div className="left-container">
                    <div className="poke-container">poke1</div>
                    <div className="poke-container">poke2</div>
                    <div className="poke-container">poke3</div>
                    <div className="poke-container">poke4</div>
                    <div className="poke-container">poke5</div>
                    <div className="poke-container">poke6</div>
                </div>
                <div className="right-container">
                    
                </div>
            </>
        )
    }
}
